import './Home.css';
import Nav from "../components/Nav";

const Home = () => {

    const authToken = false;

    const handledClick = () => {
        console.log("clicked");
    }

    return (
        <div className="overlay">
            <Nav minimal={false} authToken={authToken}/>
            <div className="home">
                <h1>Swipe Right<span>&#174;</span></h1>
                <button className="primary-button" onClick={handledClick}>
                    {authToken ? "Signout" : "Create Account"}
                </button>
            </div>
        </div>
    )
}
export default Home
